import { useState, useEffect } from 'react'
import {Link} from 'react-router-dom'
import Header from '../../components/Header';
import Title from '../../components/Title';
import './dashboard.css'
import { FiMessageSquare, FiPlus, FiSearch, FiEdit2, FiRadio } from 'react-icons/fi'

import firebase from '../../services/firebaseConnection'

// Var de referencia para evitar repetição de codigo
const listRef = firebase.firestore().collection( 'chamados' ).orderBy( 'criado', 'desc' )
.limit(5)


export default function Dashboard() {
  const [chamados, setChamados] = useState( [] )
  const [loading, setLoading] = useState( true )
  const [carregaMais, setCarregaMais] = useState( false )
  const [estaVazia, setEstaVazia] = useState(false)

  useEffect( () => {

    buscarChamadosFirebase()

    return () => {
      // Para quando o component for desmontado
    }
  }, [] )

  async function buscarChamadosFirebase() {
    await listRef.limit( 5 )
      .get()
      .then( (snapshot) => {
        acessaAndMonta(snapshot)
      } )
      .catch( ( erro ) => {
        console.log( erro );
        setCarregaMais(false)
      } )
    setLoading(false)
  }

  // Acessado a promisse com a response e montando a lista com chamados
  async function acessaAndMonta( snapshot ) {
    const colecaoEstaVazia = snapshot.size === 0

    if ( !colecaoEstaVazia ) {
      let lista = []

      snapshot.forEach(doc => {
        lista.push( {
          id: doc.id,
          automovel: doc.data().automovel,
          cliente: doc.data().cliente,
          clienteID:doc.data().clienteID,
          complemento: doc.data().complemento,
          criado: doc.data().criado,

        })
      });
    }
  }

 return (
   <div>
     <Header/>
     <div className='content'>
       <Title name='Atendimentos'>
         <FiMessageSquare size={25}/>
       </Title>

       {/* Renderiza quando não tem chamados */}
       {chamados.length === 0 ? (
         <div className='container dashboard'>
         <span>Nenhum chamado registrado</span>

         <Link to='/novo' className='novo'>
              <FiPlus size={25} color='#FFF'/>
                      Novo chamado
         </Link>
       </div>
       ) : (
           <>
           <Link to='/novo' className='novo'>
             <FiPlus size={25} color='#FFF'/>
                   Novo chamado
             </Link>

             <table>
               {/* Tag cabeçalho */}
               <thead>
                 <tr> 
                   <th scope='col'>Cliente</th>
                   <th scope='col'>Automóvel</th>
                   <th scope='col'>Placa</th>
                   <th scope='col'>Serviço</th>
                   <th scope='col'>Status</th>
                   <th scope='col'>Cadastrado em</th>
                   <th scope='col'>#</th>
                 </tr>
               </thead>
                <tbody>
                 <tr>
                   <td data-label='Cliente'>João</td>
                   <td data-label='Automovel'>Honda Civic</td>
                   <td data-label='Placa'>PLAD8103</td>
                   <td data-label='Servico'>Remap</td>
                   <td data-label='Status'>
                     <span className='badge' style={{backgroundColor:'#5cb85c'}}>Em Aberto</span>
                   </td>
                   <td data-label='Cadastrado'>20/06/2021</td>
                   <td data-label='#'>
                     <button className='action' style={{backgroundColor:'#3583'} }>
                       <FiSearch color='#FFF' size={17}/>
                     </button>
                     <button className='action' style={{backgroundColor:'#F6a935'} }>
                       <FiEdit2 color='#FFF' size={17}/>
                     </button>
                   </td>
                 </tr>
                </tbody>

             </table>
         </>
       )}


     </div>

   </div>
 );
}
